import { jsx } from "@emotion/core";
import { style, barNum } from "./HelixStyle";
export function HelixLoading() {
    const list = [];
    for (let i = 0; i < barNum; i++) {
        list.push(jsx("span", { css: style[`bar-${i}`], key: i }));
    }
    return jsx("div", { css: style.container, className: "cl-HelixLoading" }, list);
}
